import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import axios from 'axios';

const PatientDashboard = () => {
  const { user } = useAuth();
  const [patient, setPatient] = useState(null);
  const [appointments, setAppointments] = useState([]);

  useEffect(() => {
    fetchPatientData();
    fetchAppointments();
  }, []);

  const fetchPatientData = async () => {
    try {
      const response = await axios.get('/api/patients/profile');
      setPatient(response.data.data.patient);
    } catch (error) {
      console.error('Error fetching patient data:', error);
    }
  };

  const fetchAppointments = async () => {
    try {
      const response = await axios.get('/api/appointments/my-appointments');
      setAppointments(response.data.data.appointments);
    } catch (error) {
      console.error('Error fetching appointments:', error);
    }
  };

  

  return (
    <div className="container">
      <div className="dashboard-header">
        <h1>Welcome, {patient?.fullName || user?.username}</h1>
        <div className="dashboard-actions">
          <button 
            className="btn"
            onClick={() => window.location.href = '/book-appointment'}
          >
            <i className="fas fa-plus"></i> Book Appointment
          </button>
        </div>
      </div>

      <div className="dashboard-grid">
        <div className="dashboard-card">
          <h2><i className="fas fa-calendar-alt"></i> Upcoming Appointments</h2>
          <div className="appointment-list">
            {appointments.slice(0, 3).map(appointment => (
              <div key={appointment._id} className="appointment-item">
                <div className="appointment-time">
                  {new Date(appointment.date).toLocaleDateString()}
                </div>
                <div className="appointment-details">
                  <h3>Dr. {appointment.doctor?.name}</h3>
                  <p>{appointment.purpose}</p>
                  <span className={`status-badge ${appointment.status.toLowerCase()}`}>
                    {appointment.status}
                  </span>
                </div>
              </div>
            ))}
          </div>
        </div>

        <div className="dashboard-card">
          <h2><i className="fas fa-user-injured"></i> Patient Information</h2>
          {patient && (
            <div className="patient-info">
              <p><strong>Patient ID:</strong> {patient.patientId}</p>
              <p><strong>Age:</strong> {patient.age}</p>
              <p><strong>Gender:</strong> {patient.gender}</p>
              <p><strong>Blood Group:</strong> {patient.bloodGroup || 'Not specified'}</p>
              <p><strong>Phone:</strong> {patient.contact?.phone}</p>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default PatientDashboard;
